import React from 'react';
import { Card, ListGroup, Container } from 'react-bootstrap';

const Notifications = () => {
  const notifications = [
    { id: 1, message: 'Alice liked your post.', timestamp: '2 hours ago' },
    { id: 2, message: 'Bob sent you a message.', timestamp: '5 hours ago' },
    { id: 3, message: 'Charlie commented on your post.', timestamp: '1 day ago' },
  ];

  return (
    <Container className="my-4">
      <h1>Notifications</h1>
      <Card>
        <Card.Body>
          <ListGroup>
            {notifications.map(notification => (
              <ListGroup.Item key={notification.id}>
                <div>{notification.message}</div>
                <small className="text-muted">{notification.timestamp}</small>
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default Notifications;
